import React, { Component } from 'react';

class Header extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const { user } = this.props;
        return (
            <div className="info">
                {
                    user &&
                    <li class="dropdown">
                        <a class="dropdown-toggle" data-toggle="dropdown" href="#">Welcome, {user.name} <b class="caret"></b></a>
                        <ul class="dropdown-menu">
                            <li><a href="#jquerytab" role="tab" data-toggle="tab">jQuery</a></li>
                            <li><a href="#bootstab" role="tab" data-toggle="tab">Bootstrap</a></li>
                            <li><a href="#htmltab" role="tab" data-toggle="tab">HTML</a></li>
                        </ul>
                    </li>
                }
            </div>
        )
    }
}

export default Header;
